import * as React from 'react';
import Box from '@mui/material/Box';
import { DataGrid } from '@mui/x-data-grid';
import getData from '../util/getData';


export default class Courses extends React.Component{

  constructor(props){
    super(props);
    this.state = {
        courses:{},
        loaded:false
    }
  } 

render() {
  const columns = [
    { field: 'id', headerName: 'ID', width: 100 },
    {
      field: 'employer',
      headerName: 'Employer',
      width: 150,
      editable: true,
    },
    {
      field: 'degree',
      headerName: 'Degree',
      width: 150,
      editable: true,
    },
    {
      field: 'city',
      headerName: 'City',
      width: 150,
      editable: true,
    },
    {
      field: 'term',
      headerName: 'Term',
      width: 150,
      editable: true,
    },
  ];


// return renderPane(title, group);



return(
  <div>
      courses.coopTable.map((p) {


             <div className='tab'>
                <Box className='gridBox'>
                   <DataGrid
                     columns={columns}
                     pageSize={5}
                     rowsPerPageOptions={[5]}
                     checkboxSelection
                     disableSelectionOnClick
                     experimentalFeatures={{ newEditingApi: true }}
                   />
                </Box>
             </div>
      }
      </div>
)}

    componentDidMount(){
      getData('courses/')
          .then((json) => {
              this.setState({
                  courses:json,
                  loaded:true,
                  danTest:5
          });
      });
    }

}
